import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png'; // Assurez-vous que le chemin est correct

function Interface8() { 
    return (
        <div style={{ padding: '20px', textAlign: 'center', backgroundColor: '#004E92', height: '100vh', color: 'white' }}>
            {/* Barre de navigation avec logo et barre de progression */}
            <NavBar progress={90} debit={25} />

            <div style={{ marginBottom: '20px', cursor: 'pointer', color: 'black' }} onClick={handleBackClick}>
             &lt;Back
            </div>            <Link
                to="" // Chemin vers l'interface précédente
                style={{ display: 'block', marginBottom: '20px', color: 'white', textDecoration: 'none', fontSize: '16px' }}
            >
                &lt; Back
            </Link>

            {/* Contenu principal */}
            <div style={{ marginTop: '50px' }}>
                <h2>Entrez votre numéro de téléphone GSM,<br /> un commercial vous contactera</h2>
                <div style={{ marginTop: '30px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <input
                        type="text"
                        placeholder="Numéro GSM"
                        style={{
                            padding: '10px',
                            fontSize: '16px',
                            borderRadius: '5px 0 0 5px',
                            border: '1px solid #ccc',
                            outline: 'none',
                            width: '200px'
                        }}
                    />
                    <button
                        style={{
                            padding: '10px 20px',
                            fontSize: '16px',
                            borderRadius: '0 5px 5px 0',
                            border: 'none',
                            backgroundColor: '#ff4081',
                            color: 'white',
                            cursor: 'pointer'
                        }}
                    >
                        Envoyer
                    </button>
                </div>
                <Link
                    to="" // Chemin pour avancer sans entrer de numéro
                    style={{ display: 'block', marginTop: '20px', color: '#fff', textDecoration: 'none' }}
                >
                    Non Merci
                </Link>
            </div>
        </div>
    );
}

function NavBar({ progress, debit }) {
    return (
        <div style={{
            display: 'flex', justifyContent: 'space-between', alignItems: 'center',
            backgroundColor: '#00274D', color: '#fff', padding: '10px 20px'
        }}>
            <img src={logo} alt="Topnet Logo" style={{ height: '40px' }} />
            <ProgressBar progress={progress} />
            <div style={{ fontSize: '25px' }}>{debit} Mbps</div>
        </div>
    );
}

function ProgressBar({ progress }) {
    return (
        <div style={{ width: '50%', backgroundColor: '#444', borderRadius: '5px', margin: '0 20px' }}>
            <div
                style={{
                    width: `${progress}%`,
                    backgroundColor: '#ff4081',
                    height: '10px',
                    borderRadius: '5px'
                }}
            />
            <div style={{ textAlign: 'right', color: 'white', paddingTop: '5px' }}>
                {progress}%
            </div>
        </div>
    );
}

export default Interface8;
